ptxt = []
ctxt = []

for i in range(K):
    ptxt.append(random.getrandbits(64))
    ctxt.append(pow(ptxt[-1], e, Ns[i]))

M = [[0 for i in range(64)] for j in range(64)]

for i in range(K):
    for j in range(K):
        if (ctxt[j] & (1 << i)) != 0:
            M[i][j] = 1

V = [(1 if (target & (1 << i)) != 0 else 0) for i in range(K)]

F = GF(2)
A = matrix(F, M)
B = vector(F, V)

ans = A.solve_right(B)
fin = [(ptxt[i] if ans[i] == 1 else 0) for i in range(K)]
print(fin)

E = ARC4.new(key)
v = 0
cur = v
for i in range(K):
    pt = (pow(fin[i],e,Ns[i])^cur)%(1<<64)
    ct = unpack('Q', E.encrypt(pack('Q',pt)))[0]
    cur = ct

print(cur == 0)

from pwn import *

proc = remote("pwnable.org", 10001)
proof = proc.recvline().strip().split()
ans = iters.mbruteforce(lambda x: hashlib.sha256(x.encode() + proof[0][12:-1]).hexdigest().encode() == proof[-1], string.ascii_letters + string.digits, 4, 'fixed')
proc.sendline(ans)

proc.recvuntil("message: ")
proc.sendline("pepega")
for i in range(K):
    print(proc.recvuntil(": ").strip())
    proc.sendline(str(fin[i]))
proc.recvuntil("v: ")
proc.sendline("0")

proc.interactive()

